import { motion } from "framer-motion"
// import estyle from "./About.module.scss"

function About({props}) {

    const svgVariants = {
        ready: { opacity:0 },
        start: { opacity:1, 
            transition: { 
                // scaleY: { delay: 2.35, duration: .25, type:'tween', ease:'easeIn' },
                // y: { delay:2.35, duration: .25, type: 'tween', ease:'easeIn' },
                // scaleX: { delay: 2.6, duration: .25, type:'tween', ease:'backOut' }
                opacity: { delay:1, duration:1 }
            }
        },
        exit: {opacity:0, transition: {opacity: {duration:1}}}
    }

    return (
        // <div className={estyle.container}>
        //     <h1 className={estyle.title}>About Us</h1>
        // </div>
        <motion.div
            variants={svgVariants}
            initial="ready"
            animate="start"
            exit="exit"
        >
            <h1>about</h1>
        </motion.div>
    )
}
export default About;
